import { BrowserRouter as Router } from "react-router-dom";
import { Switch, Route } from 'react-router-dom';
import { IndexPage } from "./pages/index";
import { NotFoundPage } from "./pages/NotFound";
import { LoginPage } from "./pages/Login";

export const Routes = () => {
    return (
        <Router>
            <Switch>
                <Route path="/">
                    <IndexPage />
                </Route>
                <Route path="/Login">
                    <LoginPage />
                </Route>
                <Route>
                    <NotFoundPage />
                </Route>
            </Switch>
        </Router>
    )
}
